    false,nt"url": null,nt"notes": "The sediments and geomorphology of a portion
    of the northeastern continental shelf between Hudson Canyon and Georges Bank have
    been investigated. Wave-cut terraces at 13, 45, 65, and 80 fathoms indicate four
    former low sea levels, while concentrations of beach ridges around 35 fathoms reveal
    a fifth. The pre-Holocene drainage pattern, still exposed over part of the area,
    shows that Block Channel was the main stream system which drained most of southern
    New England. The surface sediments on the western part of the study area are Late
    Pleistocene fluvial deposits. Overlying these coarse deposits in the central part
    of the outer shelf is a sandy silt facies that is also relict. The youngest facies
    and the only area of present deposition, is in the northeastern part where sand
    eroded from Nantucket Shoals is being deposited on the shelf.",nt"owner_org":
